import React from 'react'
import SingleJuiceBody from "../components/SingleJuiceBody";
import Navbar from "../components/Navbar";
import CartPage from "./CartPage";

const SingleJuicePage = ({ cart, setCart, juices, setJuices}) => {
    return(
        <div>
            <Navbar />
            <SingleJuiceBody cart={cart} setCart={setCart} juices={juices} setJuices={setJuices} />
        </div>
    )
}
export default SingleJuicePage
